import logo from './logo.svg';
import './App.css';
import React, { useState , useEffect } from 'react'

class App extends React.Component(){

    // Constructor 
    constructor(props) {
        super(props);

        this.state = {
            items: [],
            DataisLoaded: false
        };
    }

    componentDidMount() {
        fetch("/agents")
            .then((res) => res.json())
            .then((json) => {
                this.setState({
                    agents: json,
                    DataisLoaded: true
                });
            })
    }

    render() {
        const { DataisLoaded, items } = this.state;
        if (!DataisLoaded) return <div>
            <h1> Please wait some time.... </h1> </div> ;

        return (
        <div className = "App">
            <h1> Fetch data from an api in react </h1>  {
                items.map((item) => ( 
                <ol key = { item.id } >
                    agent_id: { item.agent_id }, 
                    cur_pos: { item.cur_pos }, 
                    angle: { item.angle } ,
                    ag_color: { item.color }
                    </ol>
                ))
            }
        </div>
    );
}
}


export default App;
